Here’s a revised version of your function that checks for disallowed characters in a string:

```javascript
function isValidString(str) {
    // Define a regular expression that matches any character that is NOT allowed.
    // This includes characters that are not alphanumeric, hyphens, underscores, or periods.
    const disallowedChars = /[^a-zA-Z0-9\-_\.]/;

    // Test the string against the regular expression.
    // If the test returns true, it means there are disallowed characters.
    // If it returns false, the string is valid.
    return !disallowedChars.test(str);
}

// Example usage:
console.log(isValidString("example.com")); // true
console.log(isValidString("example.com/")); // false
console.log(isValidString("example.com?query=123")); // false
```

### Explanation

1. **Regular Expression**: The regular expression `/[^a-zA-Z0-9\-_\.]/` is used to match any character that is not a letter (both uppercase and lowercase), a digit, a hyphen (`-`), an underscore (`_`), or a period (`.`). The caret (`^`) inside the brackets negates the set, meaning it matches any character not listed.

2. **Testing the String**: The `test` method of the regular expression object checks if the string contains any characters that match the pattern (i.e., any disallowed characters). If it finds any, it returns `true`, indicating the presence of disallowed characters.

3. **Return Value**: The function returns `true` if the string does not contain any disallowed characters (i.e., it is valid), and `false` otherwise.

Feel free to adjust the regular expression based on the specific set of characters you want to allow or disallow. If you have any more specific requirements or need further assistance, let me know!

